import React from "react";
import { Grid, Paper } from "@material-ui/core";

function Main() {
  return (
    <div>
      <Grid item xs={6}>
        <Paper>xs=6</Paper>
      </Grid>
      <Grid item xs={6}>
        <Paper>
          <h1>We Are Voice Tech for Kids.</h1>
          <p>
            Proprietary and built from the ground up, our technology
            voice-enables remote learning literacy and language tools, toys and
            games for kids ages 3-12 years.
          </p>
        </Paper>
      </Grid>
    </div>
  );
}

export default Main;
